In rust, struct method calls are grouped into Traits . We can see which trait is needed to display our custom struct from the compiler: struct Wrap { filling: String
} fn main() { let wrap = Wrap { filling: String::from("falafel"), }; println!("{}", wrap)
} error[E0277]: `Wrap` doesn't implement `std::fmt::Display` --> /tmp/mdbook-b59VOb/display_formatting.md:61:20 |
10 | println!("{}", wrap) | ^^^^ `Wrap` cannot be formatted with the default formatter | = help: the trait `std::fmt::Display` is not implemented for `Wrap` = note: in format strings you may be able to use `{:?}` (or {:#?} for pretty-print) instead = note: required by `std::fmt::Display::fmt` This tells us we have a couple of things: we cannot format wrap in this way with println! because it's missing the fmt::Display trait the function that requires this trait is fmt::Display::fmt We can implement the Display trait ourselves: use std::fmt; struct Wrap { filling: String
} impl fmt::Display for Wrap { fn fmt(&self, f: &mut fmt::Formatter) -> fmt::Result { write!(f, "<Wrap with {} filling>", self.filling) }
} fn main() { let wrap = Wrap { filling: String::from("falafel"), }; println!("{}", wrap) // <Wrap with falafel filling>
} Or we can derive the Debug trait that rust provides. #[derive(Debug)]
struct Wrap { filling: String
} fn main() { let wrap = Wrap { filling: String::from("falafel"), }; println!("{:?}", wrap) // Wrap { filling: "falafel" }
} What's going on here? Rust implements the Debug trait on all primitive types. We can derive this trait for our new struct, if all the fields implement Debug themselves. The derive macro will take care of writing the impl Debug for Wrap block for use, and asking it to call the corresponding methods on child values (such as println!("{:?}", self.filling) ).

