In rust: references are noted explicitly using the & operator. mutable data structures are noted explicitly using the mut keyword. Here we can see that the Vec is mutable, so we should expect the values to change. fn main() { let mut numbers = vec![0, 1]; numbers[0] += 100; println!("{:?}", numbers); // [100, 1]
} If we write this like our python example, Rust throws us a nice compiler error: fn main() { let numbers = vec![0, 1]; // error[E0382]: use of moved value: `numbers` let mut matrix = vec![numbers, numbers]; matrix[0].push(2); println!("{:?}", matrix);
} Rust is telling us that we are being ambiguous about how we want to duplicate data here. We can either explicitly use the same Vec twice, and store two references to it: fn main() { let mut numbers = vec![0, 1]; let mut matrix = [&numbers, &numbers]; println!("{:?}", matrix); // [[0, 1], [0, 1]]
} Or, we can clone numbers to form a second vector, which will allow us to mutate one at a time: fn main() { let numbers_0 = vec![0, 1]; let numbers_1 = numbers_0.clone(); let mut matrix = vec![numbers_0, numbers_1]; matrix[0].push(2); println!("{:?}", matrix); // [[0, 1, 2], [0, 1]]
}

