Traits are rust's way of pulling together several concepts found in python: magic methods abstract base classes *-like objects In rust we can enforce that a struct has associated methods by defining a trait: struct Dog { age: i64,
} trait AnimalAge { fn relative_age(&self) -> i64;
} impl AnimalAge for Dog { fn relative_age(&self) -> i64 { self.age * 7 }
} fn main() { let gaspode = Dog { age: 9, }; println!("{}", gaspode.relative_age()); // 63
} The above example explains that: the trait AnimalAge contains the method relative_age Dog has an implementation for AnimalAge gaspode is an instance of Dog therefore, we can call gaspode.relative_age() and know the method exists If we forgot to add our implementation using impl AnimalAge for Dog , we would see struct Dog { age: i64,
} trait AnimalAge { fn relative_age(&self) -> i64;
} fn main() { let gaspode = Dog { age: 9, }; println!("{}", gaspode.relative_age());
